files.content:
{
	"tabWidth": 4,
	"useTabs": true,
	"printWidth": 110,
	"endOfLine": "lf",
	"overrides": [
		{
			"files": "*.md",
			"options": {
				"proseWrap": "always",
				"tabWidth": 2,
				"embeddedLanguageFormatting": "off"
			}
		},
		{
			"files": ["*.yml", "*.yaml"],
			"options": {
				"tabWidth": 2,
				"useTabs": false
			}
		},
		{
			"files": "*.json",
			"options": {
				"tabWidth": 2
			}
		}
	]
}

{
	"packages": {
		".": {
			"release-type": "simple"
		}
	},
	"changelog-sections": [
		{
			"type": "feat",
			"hidden": false,
			"section": "Features"
		},
		{
			"type": "fix",
			"hidden": false,
			"section": "Bug Fixes"
		},
		{
			"type": "perf",
			"hidden": false,
			"section": "Performance Improvements"
		},
		{
			"type": "revert",
			"hidden": false,
			"section": "Reverts"
		},
		{
			"type": "docs",
			"hidden": false,
			"section": "Documentation"
		},
		{
			"type": "style",
			"hidden": false,
			"section": "Styles"
		},
		{
			"type": "refactor",
			"hidden": false,
			"section": "Code Refactoring"
		},
		{
			"type": "test",
			"hidden": false,
			"section": "Tests"
		},
		{
			"type": "build",
			"hidden": false,
			"section": "Build System"
		},
		{
			"type": "ci",
			"hidden": false,
			"section": "Continuous Integration"
		},
		{
			"type": "chore",
			"hidden": false,
			"section": "Chores"
		},
		{
			"type": "other",
			"hidden": false,
			"section": "Others"
		}
	]
}
